import React from "react";
import "./style.css";

function SearchForm(props) {
    return (
        <div className="input-group mb-3" id="search">
            <input 
                value={props.search}
                onChange={props.handleInputChange}
                type="text" 
                class="form-control" 
                placeholder="Search for an employee">
            </input>
        </div>

    )
}

export default SearchForm;
